import Header from '../components/Header';
import Layout from '../Components/Layout';
import Form from '../Components/Form';
class Index extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: ''
        }
    }
    render(){
        return (
            <Layout>
                <p>Hej</p>
                <Form></Form>
            </Layout>
        );
    }
}
export default Index;
